  \"2015-09-26T23:27:15.462836\",\n\t\"name\": \"tao-triton-rama-and-pirata-buoys-monthly-dynamic-height\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset has monthly Dynamic Height
  data (a measure of the elevation of the sea level, calculated by integrating the
  specific volume anomaly of the sea water between the sea surface and 500 m depth)
  from the nTAO/TRITON (Pacific Ocean, http://www.pmel.noaa.gov/tao/),nRAMA (Indian
  Ocean, http://www.pmel.noaa.gov/tao/rama/), andnPIRATA (Atlantic Ocean, http://www.pmel.noaa.gov/pirata/)narrays
  of moored buoys which transmit oceanographic and meteorological data to shore in
  real-time via the Argos satellite system.  These buoys are major components of the
  CLIVAR climate analysis project and the GOOS, GCOS, and GEOSS observing systems.
  \ Monthly data is an average of daily values collected during a month.  A minimum
  of 15 daily values are required to compute a monthly average.  This dataset contains
  realtime and delayed mode data (see the 'source' variable).  For more information,
  seenhttp://www.pmel.noaa.gov/tao/proj_over/proj_over.html .\",\n\t\"license_title\":
